//COMPONENTS
import NavBar from "../components/NavBar";
import { Container, Row, Col } from "react-bootstrap";

const Home = () => {
  return (
    <Container fluid>
      <NavBar />
      <Row className="justify-content-xs-center">
        <Col xxl="3">
          <h1>Homes</h1>
        </Col>
      </Row>
    </Container>
  );
};

export default Home;
